  render(){

// import Background from './images/backgroundimage.png';
    return(
      <section id="footer">
      <img src="${Logo}" />
      <ul className="header-styles">
      <li>About</li>
        <li>Contact</li>
          <li>Home</li>
      </ul>
      </section>
    )
  }
}

export default Header;
